  \"2014-04-15T17:01:38.973787\",\n\t\"name\": \"des-base-map-project-aerial-photography-2009-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This imagery is derived from NDDOT interim
  working data and is used to digitize road centerline vector information for the
  DES Base Map Project.The digitized centerlines will be created with a \"sub-meter\"
  accuracy. The imagery will be collected during optimum viewing conditions whenever
  possible, however maximizing flight mission time is also a major priority. Ideal
  flying conditions would be during spring and fall seasons when tree and foliage
  cover is reduced, thus optimizing the viewing accuracy of roadway centerlines. Other
  factors affecting image quality can be sun angle, haze, wind speed, turbulence and
  cloud cover. The flight missions are also prioritized to capture certain PSAP (Public
  Safety Answering Point) areas ahead of other counties; However once again, weather
  conditions dictate where and when the flight crew can collect data.Certain image
  anomalies will be visible within the mosaics. These small warpages were addressed
  during the digitizing phase by using imagery imported from other stages of the process.
  It is the intent of NDDOT to eventually address all of these anomalies but at this
  stage of the project, production speed is a higher priority.Pixel size is approximately
  0.9-feet, data is processed to UTM-14, NAD83The Base Map missions are created at
  a flight height above ground (HAG) of 9,000' (2743.2 meters) which creates imagery
  with a .90'(27.432 cm) ground sample distance (GSD). The resultant imagery covers
  a base corridor 12,400' (3779.52 meters) wide.\",\n\t\"license_title\": null,\n\t\"extras\":
